const Nav = () => (
  <nav className="flex flex-row gap-4 font-display font-light">
    <Link href="/">
      <h2>HOME</h2>
    </Link>
    <h2>•</h2>
    <h2>PROJECTS</h2>
    <h2>•</h2>
    <h2>ABOUT</h2>
  </nav>
);

export default Nav;
